INSERT INTO `labor` (`id`, `nama_Labor`, `deskripsi`, `logo`, `nama_pembina`, `createdAt`, `updatedAt`) VALUES
('476fe739-77f6-43e0-af24-45f3c0a90543', 'Laboratorium of Enterprise Application', 'Laboratorium of Enterprise Application (LEA) adalah salah satu labor yang ada pada jurusan Sistem Informasi Universtas Andalas (Unand) yang bergerak dalam bidang penelitian dan penggunaan teknologi dan layanan sistem informasi pada organisasi atau perusahaan.', 'logolea_1730863762674.png', 'Adi Arga Arifnur, M.Kom', '2024-09-05 10:35:37', '2024-11-06 03:29:24'),
('bc3487eb-bcd0-4ec3-abec-cb85a09dc291', 'Laboratorium Komputasi Dasar', 'Laboratorium Komputasi Dasar (Laboratorium Dasar Komputasi) adalah laboratorium pembelajaran di bawah naungan Departemen Sistem Informasi, Fakultas Teknologi Informasi, Universitas Andalas.\r\n\r\nKami menyediakan pekerjaan praktis tentang Dasar-Dasar Pemrograman, Struktur Data & Algoritma, Jaringan & Komunikasi Data, Basis Data, dan Pemrograman Web untuk siswa dari Departemen Sistem Informasi, Fakultas Teknologi Informasi, Universitas Andalas', 'LDKOM_1730863784555.png', 'Jefril Rahmadoni, M.Kom', '2024-11-05 14:44:33', '2024-11-06 03:29:45'),
('f9e6c2b8-8347-4249-bb67-4b833575a720', 'Laboratorium Business Intelligence', 'Laboratorium Business Intelligence merupakan salah satu laboratorium riset yang ada di Departemen Sistem Informasi Fakultas Teknologi Informasi Universitas Andalas. Laboratorium ini memiliki fokus bidang penelitian di bidang Bussiness Intelligence, Data Mining, dan Machine Learning', 'LBI_1730863800623.png', 'Dwi Welly Sukma Nirad, M.T', '2024-08-13 07:24:07', '2024-11-06 03:30:01'),
('fbe2d0c5-1501-4c97-91a6-1e338cd143ec', 'Laboratory of Geographic Information System', 'Laboratory of Geographic Information System (LabGIS) merupakan laboratorium yang berada di Jurusan Sistem Informasi, Fakultas Teknologi Informasi Universitas Andalas. yang berfokus di bidang ilmu Sistem Informasi Geografis. LabGIS sebelumnya bernama Laboratorium Sistem Informasi (LSI) dan merupakan laboratorium pertama di Jurusan Sistem Informasi. Labor ini resmi berdiri pada hari Selasa, 16 Oktober 2012.', 'LABGIS_1730863818866.png', 'Prof. Surya Afnarius Ph.D', '2024-08-13 07:04:30', '2024-11-06 03:30:19');

